    get field() {
        return this._field;
    }
    get title() {
        return this._title;
    }
    get description() {
        return this._description;
    }
    get value() {
        return this._isOn;
    }
    on() {
        this._isOn = true;
    }
    off() {
        this._isOn = false;
    }
}
